sources.styles/_variables.scss:
@import url("https://fonts.googleapis.com/css2?family=Libre+Baskerville:ital@1&family=Playfair+Display:wght@400;700;900&family=Raleway:wght@400;700&display=swap");

//MEDIA QUERIES
$max-s: 480px;
$max-m: 768px;
$max-l: 1024px;
$max-xl: 1100px;

//COLOURS
$primary: #343539;
$secondary: #ac9b8c;
$blush: #d9d2cd;
$blue-gray: rgb(110, 110, 118);
$light-gray: #f5f5f5;
$dark-grey: #c8cbd1;
$text: #343539;
$white: rgb(255, 255, 255);
$black: #000000;
//TYPOGRAPHY

$serif: "Playfair Display", serif !default;
$sans-serif: "Raleway", sans-serif !default;
$quote: "Libre Baskerville", serif !default;
$italic: italic;
$bold: 700;
$extra-bold: 900;
$center: center;
$left: left;
$justify: justify;
$border: 2px solid $secondary;
$border-black: 1px solid $blue-gray;

$font-l: 3rem;
$font-ml: 2rem;
$font-m: 1.6rem;
$font-s: 1.2rem;
$font-xs: 1rem;

//PADDING & MARGIN

$padding-xl: 4rem;
$padding-l: 1.5rem;
$padding-m: 1rem;
$padding-s: 0.5rem;
$padding-xs: 0.2rem;
$padding-quote: 0.5rem 0 0 2rem;
$margin-quote: 0.5rem 0 0 2rem;
$margin-send: 0.4rem 0rem 0 1rem;

//WIDTH & HEIGHT
$max-width: 100%;

//GRID

$grid: grid;
$hidden: hidden;
$auto: auto;
$grid-column-l: 2fr 1fr;
$grid-column-m: repeat(4, 7rem);
$grid-column-s: repeat(2, 1fr);

sources.styles/_base.scss:
* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
  font-family: $serif;
}

li {
  list-style: none;
}
a {
  text-decoration: none;
  list-style: none;
}

//MIXIN
@mixin main-text {
  color: $text;
  letter-spacing: 0.1rem;
  text-align: $center;
}

@mixin paragraph-text {
  color: $text;
  font-family: $sans-serif;
  font-size: $font-s;
  line-height: 2rem;
  padding-bottom: 1rem;
  font-weight: 200;
}

@mixin quote-text {
  color: $blue-gray;
  font-family: $quote;
  font-size: $font-xs;
  text-align: $center;
  font-style: italic;
  font-weight: 100;
}

@mixin input-text {
  color: $secondary;
  font-family: $sans-serif;
  font-size: $font-s;
}

@mixin categories {
  font-family: $quote;
  font-size: 1rem;
  color: $text;
  text-decoration: none;
  text-align: center;
  &:hover {
    color: $blush;
  }
}

@mixin categories {
  font-family: $quote;
  font-size: 1rem;
  color: $text;
  text-decoration: none;
  text-align: center;

  &:hover {
    color: $blush;
  }
}

@mixin flex {
  display: flex;
}
@mixin flex-column {
  display: flex;
  flex-direction: column;
  align-items: center;
}

@mixin padding-xl {
  padding: $padding-l;
}

@mixin grid {
  display: grid;
  grid-template-columns: repeat(1, 1fr);
  grid-column-gap: 1rem;
  grid-row-gap: 4rem;
  justify-content: center;

  @media (min-width: $max-s) {
    grid-template-columns: repeat(2, 1fr);
  }
  @media (min-width: $max-l) {
    grid-template-columns: repeat(3, 1fr);
  }
}

@mixin flex-column {
  display: flex;
  flex-direction: column;
  align-items: center;
}

@mixin padding-xl {
  padding: $padding-xl;
  @media (max-width: $max-m) {
    padding: $padding-l;
  }
}

@mixin grid {
  display: grid;
  grid-template-columns: repeat(auto-fit, 22.8rem);
  grid-column-gap: 1rem;
  grid-row-gap: 4rem;
  justify-content: center;
}

//TYPOGRAPHY
h1 {
  @include main-text;
  font-size: $font-ml;
  padding-bottom: 1rem;

  @media (min-width: $max-s) {
    font-size: $font-l;
  }
  & a {
    @include main-text;
  }
}

h2 {
  @include main-text;
  font-weight: $bold;
  font-size: $font-m;
  padding-bottom: 1rem;
}

h3 {
  @include main-text;
  text-align: $left;
  font-weight: normal;
  letter-spacing: 0.05rem;
}

h4 {
  @include quote-text;
  padding-bottom: 3rem;
}
h5 {
  @include main-text;
  font-size: $font-xs;
  padding: 1.5rem 0;
  border: $border-black;
  position: absolute;
  bottom: 0;
  width: 100%;
  background-color: $white;

  &:hover {
    color: $blush;
  }
  @media (min-width: $max-s) {
    font-size: $font-s;
  }
}

h5 {
  @include main-text;
  font-weight: normal;
  font-size: $font-s;
  padding: 1.5rem 0;
  border: $border-black;
  position: absolute;
  bottom: 0;
  width: 100%;
  background-color: $white;
  &:hover {
    color: $blush;
  }
}

h6 {
  @include input-text;
}

p {
  @include paragraph-text;
}

.highlight {
  color: $blush !important;
}

.link {
  @include paragraph-text;
  color: $secondary;
  &-button {
    @include paragraph-text;
    font-size: 1rem;
    text-decoration: none;
    border: $border;
    padding: 0.5em 1rem;
    width: fit-content;
    cursor: pointer;
    &:hover {
      background: $blush;
    }
    & a {
      all: unset;
      color: $primary;
    }
  }
}

.highlight {
  color: $blush !important;
}
.link {
  @include paragraph-text;
  color: $secondary;

  &-button {
    @include paragraph-text;
    font-size: 1rem;
    text-decoration: none;
    border: $border;
    padding: 0.5em 1rem;
