    }
  }
}
.page-heading {
  @include main-text;
  letter-spacing: 0.05rem;
  font-weight: bold;
  font-size: $font-ml;
  padding: 1rem 0 0.2rem;

  @media (min-width: $max-s) {
    font-size: 2.6rem;
  }
}
.subheading {
  @include paragraph-text;
  font-size: 1rem;
  text-align: $center;
}
.text-center {
  text-align: center;
}
.text-right {
  text-align: right;
}
.text-left {
  text-align: left;
}
.text-bold {
  font-weight: bold !important;
}
.text-italic {
  font-style: italic;
}
.padding-left {
  padding-left: 0rem;

  @media (min-width: $max-l) {
