//RESTAURANT INFO

// BOOKING
.booking {
  &-contact {
    @include flex;
    flex-direction: column;
    width: 100%;
    padding-bottom: 2rem;
    & input {
      background: transparent;
      border: $border-black;
      padding: 0.5rem;
      width: $max-width;
    }
    & label {
      @include paragraph-text;
      font-size: $font-xs;
      padding-bottom: 0.2rem;
    }
  }
}
.overlay {
  position: fixed;
  overflow-y: scroll;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  background: rgba(110, 110, 118, 0.6);
  visibility: hidden;
  opacity: 0;
  &::-webkit-scrollbar {
    background: transparent;
  }

  &:target {
    visibility: visible;
    opacity: 1;
  }
}
.content-booking {
  width: $max-width;
  text-align: center;
  @include flex-column;
}
.popup {
  width: 95%;
  padding: 2rem 1rem;
  margin: 70px auto;
  background: $light-gray;
  position: relative;
  @include flex-column;
  & .close {
    position: absolute;
    top: 5%;
    left: 95%;
    z-index: 1;
    transform: translate(-95%, -5%);
    font-size: 30px;
    font-weight: bold;
    text-decoration: none;
    color: $blue-gray;

    &:hover {
      color: $secondary;
    }
  }

  & h5 {
    border: none !important;
    font-size: $font-m;
    padding-bottom: 3rem;
    background-color: transparent;
  }
  & p {
    font-size: $font-xs;
  }
  & * {
    position: relative;
  }
}

// CALENDAR
.calendar {
  width: 100%;
  border-collapse: collapse;
  margin-bottom: 2rem;

  &-header {
    padding: 0.5rem;
    background: $blush;
  }
  &-schedule {
    width: 100%;
  }
}
td {
  border: $border-black;
  padding: 1rem 0.5rem;
  font-family: $sans-serif;
  color: $secondary;
  font-size: 0.8rem;
  text-align: $center;

  &:hover {
    background: $blush;
  }
}
//MEDIA QUERIES

@media (min-width: $max-l) {
  .content-wrapper {
    padding: 7rem 0 1rem;
    @include flex;
  }
  .popup {
    width: 80%;
    padding: 3rem 2rem 2rem;
  }
  td {
    font-size: $font-xs;
  }
  .text,
  .gallery {
    width: 50%;
  }
  .text {
    padding: 2rem 1rem 1rem;
  }
}

@media (min-width: $max-m) {
  .calendar,
  .booking-contact {
    width: 65% !important;
  }
}

@media (min-width: $max-s) {
  .calendar,
  .booking-contact {
    width: 80%;
  }
  .calendar-schedule {
    width: 100% !important;
  }
}

