  &-left,
  &-right {
    width: 50%;
  }

  &-left {
    height: 100%;
    position: sticky;
    top: 1rem;
  }
  &-right {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-column-gap: 1rem;
    grid-row-gap: 3rem;
  }
  &-bottom {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    padding: 4rem 0;
    grid-column-gap: 1rem;
    grid-row-gap: 3rem;

    & .article img {
      height: 35vh;
    }
  }
}
.article {
  width: 100%;
  display: flex;
  flex-direction: column;

  & img {
    width: 100%;
    height: 50vh;
    object-fit: cover;
  }

  & h5 {
    position: relative;
  }

  & h3:hover {
    color: $secondary;
  }

  &-featured {
    width: 100%;
    height: 90vh;
    position: sticky;

    & img {
      @extend .article-featured;
      object-fit: cover;
      position: absolute;
    }
    &-title {
      position: absolute;
      width: 50%;
      height: 25%;
      padding: 3rem 1rem 0 2rem;
      background: $blush;
      bottom: 0;
    }
  }
}
//VIDEO FEATURE

.video-featured {
  @include flex;
  & .text {
    width: 50%;
    align-self: center;
