    margin-left: 1rem;
  }
}

.return {
  position: fixed;
  left: 5rem;
  cursor: pointer;
}

//NEW ARTICLE

.new-article-wrapper {
  padding: 3rem 0;
  & .text {
    width: 50%;

    & p:hover {
      color: $secondary;
    }
  }
  & .text-2 {
    width: 70%;
  }
  & .text-3 {
    width: 30%;
  }
}
.new-article {
  &-template {
    & textarea {
      background: transparent;
      border: $border-black;
      padding: 0.5rem;
      width: $max-width;
      @include paragraph-text;
      margin-bottom: 2rem;
    }
    &-title {
      height: fit-content;
    }
    &-subheading {
      height: 10rem;
    }
    &-content {
      height: 40rem;
    }
    &-edit {
      background: transparent;
      border: $border-black;
      padding: 0.5rem;
      border-bottom: none;

